$red25: #800000;
$red20: #660000;
$red15: #4d0000;
$red10: #330000;
$red5: #1a0000;

//-----FONTS-----

@font-face {
  font-family: 'NugieItalic';
  src: local('Nugieitalic'), url(../fonts/NugieItalic.ttf) format('truetype');
	font-weight: normal;
  font-style: normal;
	font-display: swap;
