	color: $black-5;
	font-family: NugieItalic;
}

@mixin primary-font {
	color: $black-5;
	font-family: $primary-font;
}

//-----ANIMATIONS-----

.dark-glow-image {
  animation: dark-glow-image 1s ease-in-out infinite alternate;
  -webkit-animation: dark-glow-image 1s ease-in-out infinite alternate;
  -moz-animation: dark-glow-image 1s ease-in-out infinite alternate;
}

@keyframes dark-glow-image {
  from {
		filter: drop-shadow(4px 4px 10px $red10);
  }
  to {
		filter: drop-shadow(4px 4px 10px $red15);
  }
}

@-webkit-keyframes dark-glow-image {
  from {
		filter: drop-shadow(4px 4px 10px $red10);
  }
  to {
		filter: drop-shadow(4px 4px 10px $red15);
  }
}

@-moz-keyframes dark-glow-image {
  from {
		filter: drop-shadow(4px 4px 10px $red10);
  }
  to {
		filter: drop-shadow(4px 4px 10px $red15);
  }
}

@mixin cursor {
  cursor: url(../images/cursor.png), crosshair;
}

//-----COMMON STYLING-----

.visible {
	display: normal;
}

.inVisible {
	display: none;
}

.hidden {
	visibility: hidden;
}

.center-wrap {
	text-align: center;
}

.button-wrap {
	text-align: center;
	margin-top: 10px;
}

.dagger1 {
	width: 43px;
	vertical-align: middle;
	transform: scaleX(-1) rotate(75deg);
	margin-right: 20px;
}

.dagger2 {
	width: 43px;
	vertical-align: middle;
	transform: rotate(75deg);
	margin-left: 20px;
}

.list-item-link {
	@include pirate-reg;
	color: $red30;
	font-size: calc(1rem + 1.25vmin);
}

.large-list-wrap {
	display: flex;
	flex-flow: column wrap;
	justify-content: flex-start;
	align-items: flex-start;
  font-size: calc(1rem + 1.25vmin);
}

.details-button {
  @include pirate-reg;
	font-size: calc(1rem + 1.25vmin);
	text-decoration: underline;
	color: $red30;
	background: transparent;
	border: none;
}

.close-details {
  @include pirate-reg;
	font-size: calc(1.1rem + 1vmin);
	background: transparent;
	border: 3px solid $red20;
	padding: 7px;
	border-radius: 7px;
	margin: 10px auto 0;
}

.details-button:hover {
  @include cursor;
}

.close-details:hover {
  @include cursor;
}

.clearfix-wrap::after {
	content: "";
  clear: both;
  display: inline-block;
	vertical-align: top;
	width: 100%;
}

.italic {
	font-style: italic;
}

/*#endregion Global Styling*/

/*#region HTML Tag Styling*/

* {
	box-sizing: border-box;
}

html {
