.notSpinning {
  display: normal;
}

.isSpinning {
	animation: spin 4s cubic-bezier(.7,2.06,.62,.86) infinite forwards;
	-webkit-animation: spin 4s cubic-bezier(.7,2.06,.62,.86) infinite forwards;
	-moz-animation: spin 4s cubic-bezier(.7,2.06,.62,.86) infinite forwards;
}

@keyframes spin {
  100% {
		-webkit-transform: rotate(360deg); transform:rotate(360deg);
	}
}

@-webkit-keyframes spin {
	100% {
		-webkit-transform: rotate(360deg);
	}
}

@-moz-keyframes spin { 
	100% {
		-moz-transform: rotate(360deg);
	}
}

#open-chest {
	animation: invert 3s linear infinite forwards;
	-webkit-animation: invert 3s linear infinite forwards;
	-moz-animation: invert 3s linear infinite forwards;
}

@keyframes invert {
  0% {
    filter: invert(0%);
  }
	50% {
    filter: invert(75%) drop-shadow(8px 8px 20px #ffcc00);
	}
  100% {
    filter: invert(0%);
	}
}

@-webkit-keyframes invert {
  0% {
    filter: invert(0%);
  }
	50% {
    filter: invert(75%) drop-shadow(8px 8px 20px #ffcc00);
	}
  100% {
    filter: invert(0%);
	}
}

@-moz-keyframes invert {
  0% {
    filter: invert(0%);
  }
	50% {
    filter: invert(75%) drop-shadow(8px 8px 20px #ffcc00);
	}
  100% {
    filter: invert(0%);
	}
}

